import React, { useState } from "react";

const AuthForm = () => {
  const [isSignIn, setIsSignIn] = useState(true); // Toggle between sign in and sign up
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [type, setType] = useState(userType); // This could be 'client' or 'professional', you might handle this differently

  const handleSubmit = (event) => {
    event.preventDefault();
    const userData = {
      nombre: name,
      Email: email,
      contraseña: password,
      tipo: type, // This needs to be handled according to how you set up your database schema
    };
    // Here you will need to integrate with your backend API to handle sign up/sign in
    console.log(userData);
  };

  // Function to toggle between sign in and sign up mode
  const toggleForm = () => {
    setIsSignIn(!isSignIn);
    // Reset form fields when switching modes
    setName("");
    setEmail("");
    setPassword("");
  };

  return (
    <div className="user-form-area ptb-100">
      <div className="container">
        <div className="user-item">
          <h2>{isSignIn ? "Sign In" : "Sign Up"}</h2>
          <form onSubmit={handleSubmit}>
            <div className="row">
              {!isSignIn && (
                <>
                  <div className="col-lg-6">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="First Name"
                        value={firstName}
                        onChange={(e) => setFirstName(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-lg-6">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Last Name"
                        value={lastName}
                        onChange={(e) => setLastName(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-lg-6">
                    <div className="form-group">
                      <input
                        type="email"
                        className="form-control"
                        placeholder="Email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-lg-6">
                    <div className="form-group">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Phone"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                      />
                    </div>
                  </div>
                </>
              )}
              {isSignIn && (
                <div className="col-lg-12">
                  <div className="form-group">
                    <input
                      type="text"
                      className="form-control"
                      placeholder="Email or Phone"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                    />
                  </div>
                </div>
              )}
              <div className="col-lg-12">
                <div className="form-group">
                  <input
                    type="password"
                    className="form-control"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </div>
              </div>
              {!isSignIn && (
                <div className="col-lg-12">
                  <div className="form-group">
                    <input
                      type="password"
                      className="form-control"
                      placeholder="Confirm Password"
                      value={confirmPassword}
                      onChange={(e) => setConfirmPassword(e.target.value)}
                    />
                  </div>
                </div>
              )}
              <div className="col-lg-12">
                <button type="submit" className="btn cmn-btn">
                  {isSignIn ? "Sign In" : "Sign Up"}
                </button>
                <button
                  type="button"
                  className="btn cmn-btn"
                  onClick={toggleForm}
                >
                  {isSignIn ? "Sign Up" : "Sign In"}
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default AuthForm;
